package collectionPractice;

import java.util.HashSet;

public class HashSetOperations {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		HashSet set = new HashSet<>();
		set.add(null);
		set.add(2);
		set.add(1);
		set.add(6);
		set.add(9);
		set.add(5);
		
		System.out.println(set);
	}

}
